import pandas as pd
from time import sleep
from json import dumps
from kafka import KafkaProducer
import json

"""**First, we will prepare the data in json format to send to Kafka**



"""

data=pd.read_csv('/content/drive/MyDrive/ecg_pro/ecg_data.csv',)
data.iloc[:,:-1].head()

data.shape

"""# New Section

I will create a kefka producer
"""

producer = KafkaProducer(bootstrap_servers=['199.212.33.168:9092'],value_serializer=lambda x: dumps(x).encode('utf-8'))

for i in range(len(data)):

    sample = {"p_wave":data['p_wave'][i],"pr_interval": data['pr_interval'][i],"qt_interval": data['qt_interval'][i],"t_wave":data['t_wave'][i],"st_interval":data['st_interval'][i],"qrs": data['qrs'][i],"clas":float(data['clas'][i])}
    producer.send('ecg_demo', value=sample)
    sleep(1)
print("All data has been sent")